import React from 'react';
class Header extends React.Component
{
    constructor(props)
    {
        super(props);
        this.state=function ()
        {
            date: new Date();
        }
    }
    render() {
        return (
        <div class="hroot">
            <div class="hleft">Welcome to Dummy!</div>
            <div class="hright">Time is now: {this.time}</div>
        </div>
        );
    }
}
export default Header;
